import styled from "styled-components";

const Container = styled.div`
  width: 95%;
  height: 500px;
  max-width: 1200px;
  margin: 0 auto;
  margin-top: 70px;
  padding: 50px 20px;
`;

const Title = styled.div`
  width: 100%;
  font-size: 2rem;
  line-height: 2rem;
  font-weight: 800;
  text-align: left;
`;

const Subtitle = styled.div`
  width: 100%;
  font-size: 1.2rem;
  line-height: 1.2rem;
  text-align: left;
  margin-top: 40px;
`;

const ProductsContainer = styled.div`
  width: 100%;
  padding: 20px 0;
`;

const ProductsTitles = styled.div`
  width: 100%;
  margin-top: 20px;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  padding: 40px 0;
`;

const ProductsTitle = styled.div`
  width: 100px;
  flex-grow: 1;
`;

const ProductsButton = styled.div`
  width: 80px;
  flex-grow: 0;
`;

const Product = styled(ProductsTitles)`
  border: 1px solid #3d3d3d;
`;

const ProductInfo = styled(ProductsTitle)`
  text-align: center;
`;

const productTitles = ["Name", "Type", "Flexible", "Minimum", "APY"];

const ProductsPage = () => {
  return (
    <Container>
      <Title>Coinomo Yield Products</Title>
      <Subtitle>
        Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod
        tempor incididunt ut labore et dolore magna aliqua
      </Subtitle>
      <ProductsContainer>
        <ProductsTitles>
          {productTitles.map((title) => (
            <ProductsTitle>{title}</ProductsTitle>
          ))}
          <ProductsButton />
        </ProductsTitles>
        <Product>
          <ProductInfo>123</ProductInfo>
          <ProductInfo>123</ProductInfo>
          <ProductInfo>123</ProductInfo>
          <ProductInfo>123</ProductInfo>
          <ProductsButton></ProductsButton>
        </Product>
      </ProductsContainer>
    </Container>
  );
};

export default ProductsPage;
